import React, { Component } from 'react';
import Blogs from './Blogposts'
import './App.css';
import Blogposts from './Blogposts';

class App extends Component {
  state = {
    blogposts: [
      { date: 'today', age: 30, color: 'green'},
      { date: 'tomorrow', age: 29, color: 'red'},
      { date: 'yesterday', age: 28, color: 'blue'}
    ]
  }
  render() {
    return (
      <div className="container">

        <header className="home-image">
          <div className="header-logo">
            <img src="images\jmLogo.png"></img>
          </div>
          <div className="header-words">The Blog For Better</div>
        </header>

        <div className="main">
          <div className="main-intro">
            <p><strong>jjBlog</strong></p>
              "jBlog gives you the best of the best of best of the best of the best."
          </div>
        </div>

        <Blogposts />

        <footer className="footer-container">
          <p id="footer">Copyright @ 2019 JM.com</p>
        </footer>

        </div>
    );
  }
}

export default App;
